import React from "react";
import { useParams } from "react-router-dom";

// eslint-disable-next-line react-hooks/rules-of-hooks
const { cat } = useParams();

const NotFoundPage = () => <h1>404: Page Not Found {cat}</h1>;
export default NotFoundPage;
